import { Avatar } from '@mui/material';
import RemoveShoppingCartIcon from '@mui/icons-material/RemoveShoppingCart';
export default function Order(props) {
    let order = props.myOrder
    // const [bool, setBool] = useState(1);
    const dis = useDispatch()

    return (<>
    <button >{order.cart[0].name}</button>
            <Card  className='Card' sx={{width:'25vw', height:'35vh', backgroundColor:'transparent'}}>
            <CardHeader avatar={<Avatar alt="Ted talk" />}
      />
            <CardContent>
                {
                    <Typography variant="body2" color="text.secondary" component="p">
                        {order.userId},{order.cart[0].name}
                    </Typography>
                }
            </CardContent>
        </Card>

              </>
      );
}
